import React from 'react'
import "../global_css/videoInfo_css/styles.css"

class VideoInfo extends React.Component {
  render() {
    return (
      <div>
        <h1 className="">BMX Rampage: 2018 Highlights</h1>
      </div>
    )
  }
}

export default VideoInfo
